import React, { useState } from "react";
import "./form.scss";

const Form = () => {
  const [foodDetails, setFoodDetails] = useState({
    type: "",
    animals: "",
    weight: "",
    location: "",
  });

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log(foodDetails);
  };

  return (
    <div className="Card">
      <h1>Food Details</h1>
      <form>
        <label>Type of Food</label>
        <br />
        <input
          onChange={(e) =>
            setFoodDetails({ ...foodDetails, type: e.target.value })
          }
          type="text"
          id="type"
        />
        <br />

        <label>Animals</label>
        <br />
        <input
          onChange={(e) =>
            setFoodDetails({ ...foodDetails, animals: e.target.value })
          }
          type="text"
          id="for"
        />
        <br />

        <label>Weight</label>
        <br />
        <input
          onChange={(e) =>
            setFoodDetails({ ...foodDetails, weight: e.target.value })
          }
          type="text"
          id="weight"
        />
        <br />

        <label>location</label>
        <br />
        <input
          onChange={(e) =>
            setFoodDetails({ ...foodDetails, location: e.target.value })
          }
          type="text"
          id="location"
        />
        <br />

        <button
          onSubmit={(e) => {
            handleSubmit(e);
          }}
          className="btn"
        >
          List Food
        </button>
      </form>
    </div>
  );
};

export default Form;
